// src/components/Main.js
import React from 'react';
import Particles from 'react-tsparticles';
import '../styles/Main.css';

const Main = () => (
  <main className="main-section">
    <Particles
      id="tsparticles"
      options={{
        background: {
          color: {
            value: "#111"
          },
        },
        fpsLimit: 60,
        interactivity: {
          events: {
            onHover: {
              enable: true,
              mode: "repulse",
            },
          },
        },
        particles: {
          color: { value: "#ffffff" },
          links: { color: "#ffffff", distance: 150, enable: true },
          move: { direction: "none", enable: true, speed: 2 },
          number: { value: 50 },
          opacity: { value: 0.3 },
          shape: { type: "circle" },
          size: { value: { min: 1, max: 3 } },
        },
      }}
    />
    <h1>Welcome to the Future of AI-Driven Financial Systems</h1>
    <p>At Autonomy Labs, we are creating autonomous, self-improving AI models for a new era of finance and industry automation.</p>
  </main>
);

export default Main;
